import React, { Component } from 'react';
import '../assets/css/mechanics.css';
import '../assets/css/brakes_engine_electrical.css';

import '../assets/css/alfa_style.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import fusebox from "../assets/images/fusebox.jpg";
import bluetooth from "../assets/images/bluetooth.jpg";
import battery from "../assets/images/battery.jpeg";
import radio from "../assets/images/radio.jpeg";

class ElectricalComponent extends Component {
  constructor() {
    super();
    this.state = {

    };
  }


	componentDidMount() {
		fetch('http://localhost:3001/signup/')
			.then(res => res.json())
			.then(data => {
				this.setState(
					(prevState) => { return { accounts: data.info } }
				)
			});
	}

	postData(event) {
		event.preventDefault();
		console.log("here");
		let fields = this.state.fields;
		// let data = { email: "Joe", password: "Hi" };

		let data = { email: fields["email"], password: fields["password"] };
		let options = {
			method: 'post',
			headers: {
				'Content-Type': 'application/json'
			},
			body: JSON.stringify(data)
		}
		fetch('http://localhost:3001/signup/', options);
	}

  contactSubmit(e, desc, price) {
    e.preventDefault();

    if (this.handleValidation()) {
      window.location = "./home.js";
      alert("You have successfully logged in!");
    } else {
      window.location = "./login.js";
      alert("You have typed either the wrong email or password!")
    }

  }


  render() {
    let desc1 = "(NOS) Universal Fuse Box CF1 1st Series";
    let price1 = 94.99;
    let desc2 = "Bluetooth Car Adapter for Fiat, Alfa Romeo, Lancia, & More w/ Wire!";
    let price2 = 5.99;
    let desc3 = "";
    let price3 = 599.95;
    let desc4 = "";
    let price4 = 150.00;
    

    return (
      <div id="main">
